import{_ as e}from"./chunks/position_fixed.t2m3lWVy.js";import{_ as a}from"./chunks/rtl_cone.DqLhcs-v.js";import{_ as t,c as r,o as i,ab as l}from"./chunks/framework.CUflZczI.js";const s=JSON.parse('{"title":"Режим повернення (типовий транспорт)","description":"","frontmatter":{},"headers":[],"relativePath":"uk/flight_modes/return.md","filePath":"uk/flight_modes/return.md"}'),_={name:"uk/flight_modes/return.md"},o=l('<h1 id="режим-повернення-типовии-транспорт" tabindex="-1">Режим повернення (типовий транспорт) <a class="header-anchor" href="#режим-повернення-типовии-транспорт" aria-label="Permalink to &quot;Режим повернення (типовий транспорт)&quot;">​</a></h1><img src="'+e+'" title="Position fix required (e.g. GPS)" width="30px"><p>Режим польоту <em>Return</em> використовується для <em>повернення транспортного засобу до безпеки</em> по вільному шляху до безпечного пункту призначення, де він повинен приземлитися.</p><p>Наступні теми слід прочитати першими, якщо ви використовуєте ці типи транспортних засобів:</p><ul><li><a href="./../flight_modes_mc/return.html">Мультикоптери</a></li><li><a href="./../flight_modes_fw/return.html">Фікосовані крила (літаки)</a></li><li><a href="./../flight_modes_vtol/return.html">VTOL</a></li></ul><p>:::note</p><ul><li>Режим автоматичний - для керування автомобілем <em>не потрібно</em> втручання користувача.</li><li>Режим вимагає глобальної тривимірної оцінки позиції (з GPS або виведеної з <a href="./../ros/external_position_estimation.html#enabling-auto-modes-with-a-local-position">локальної позиції</a>). <ul><li>Літаючі апарати не можуть перемикатися в цей режим без глобальної позиції.</li><li>Літаючі транспортні засоби будуть аварійно переходити в безпечний режим, якщо втрачають оцінку позиції.</li></ul></li><li>Режим вимагає встановленої домашньої позиції.</li><li>Режим перешкоджає взброєнню (транспортний засіб повинен бути включеним при переході в цей режим).</li><li>Перемикачі керування RC можна використовувати для зміни режимів польоту на будь-якому автомобілі.</li><li>Рух палиць дистанційного керування в багатороторному літальному апараті (або ВТОЛ у режимі багатороторного літання) <a href="#COM_RC_OVERRIDE">за замовчуванням</a> змінить режим транспортного засобу на <a href="./../flight_modes_mc/position.html">режим позиції</a>, якщо не виникне критична аварія батареї.</li><li>VTOL повернеться як MC або FW на основі свого режиму в точці, коли режим повернення було запущено. У режимі багтороторного літання він буде дотримуватися параметрів багтороторного літання, таких як &quot;конус&quot; посадки. У режимі ФПВ він буде дотримуватися параметрів фіксованого крила (ігнорувати конус), але, якщо не використовується місійна посадка, перейде в режим багтороторного літання та посадиться у пункт призначення після нависання на висоті спуску.</li></ul><p>:::</p><h2 id="загальнии-огляд" tabindex="-1">Загальний огляд <a class="header-anchor" href="#загальнии-огляд" aria-label="Permalink to &quot;Загальний огляд&quot;">​</a></h2><p>PX4 надає кілька механізмів для вибору безпечного шляху повернення, пункту призначення та посадки, включаючи використання домашнього місця, точок ралі (&quot;безпечні&quot;), шляхів місії та послідовностей посадки, визначених у місії.</p><p>Усі транспортні засоби <em>нормально</em> підтримують всі ці механізми, проте не всі з них мають такий же сенс для певних транспортних засобів. Наприклад, багатокоптер може приземлитися практично будь-де, тому використання послідовності посадки для нього не має сенсу, крім випадків, які трапляються рідко. Так само, фіксований крилообразний транспортний засіб повинен пролетіти безпечний шлях до посадки: він може використовувати домашнє місце як точку повернення, але за замовчуванням не буде намагатися приземлитися на ньому.</p><p>Ця тема охоплює всі можливі типи повернення, які будь-який транспортний засіб <em>може</em> бути налаштований використовувати — теми про режими повернення для кожного конкретного транспортного засобу включають тип та конфігурацію повернення за замовчуванням/рекомендовану для кожного транспортного засобу.</p><p>Наступні розділи пояснюють, як налаштувати <a href="#return_types">тип повернення</a>, <a href="#minimum-return-altitude">мінімальну висоту повернення</a> та <a href="#loiter-landing-at-destination">поведінку під час посадки/прибуття</a>.</p><p><a id="return_types"></a></p><h2 id="типи-повернень-rtl-type" tabindex="-1">Типи повернень (RTL_TYPE) <a class="header-anchor" href="#типи-повернень-rtl-type" aria-label="Permalink to &quot;Типи повернень (RTL_TYPE)&quot;">​</a></h2><p>PX4 надає чотири альтернативні підходи для пошуку безперешкодного шляху до безпечного пункту призначення та/або посадки, які встановлюються за допомогою параметра <a href="#RTL_TYPE">RTL_TYPE</a>.</p><p>На високому рівні є:</p><ul><li><a href="#home_return">Повернення до дому/точки ралі</a> (<code>RTL_TYPE=0</code>): Підняття на безпечну висоту та повернення за прямим шляхом до найближчої точки ралі або дому.</li><li><a href="#mission-landing-rally-point-return-type-rtl-type-1">Повернення за місією до точки посадки/точки ралі</a> (<code>RTL_TYPE=1</code>): Підняття на безпечну висоту, прямий політ до найближчої точки призначення <em>окрім дому</em>: точки ралі або початку посадки за місією. Якщо не визначено пунктів посадки або збору місії, поверніться додому прямим шляхом.</li><li><a href="#mission-path-return-type-rtl-type-2">Повернення за маршрутом місії</a> (<code>RTL_TYPE=2</code>): Використання маршруту місії та швидке продовження до посадки за місією (якщо визначено). Якщо місія <em>приземлення</em> не визначена, швидко повертайте місію додому. Якщо не визначено <em>місію</em>, повернення відбувається безпосередньо до дому (точки ралі ігноруються).</li><li><a href="#closest-safe-destination-return-type-rtl-type-3">Повернення до найближчого безпечного місця призначення</a> (<code>RTL_TYPE=3</code>): Підняття на безпечну висоту та повернення за прямим шляхом до найближчого місця призначення: дому, початку маршруту посадки за місією або точки ралі. Якщо пунктом призначення є схема приземлення, дотримуйтеся цієї схеми, щоб приземлитися.</li></ul><p>Більш детальні пояснення щодо кожного з типів наведено в наступних розділах.</p><p><a id="home_return"></a></p><h3 id="тип-повернення-додому-точка-збору-rtl-type-0" tabindex="-1">Тип повернення додому/точка збору (RTL_TYPE=0) <a class="header-anchor" href="#тип-повернення-додому-точка-збору-rtl-type-0" aria-label="Permalink to &quot;Тип повернення додому/точка збору (RTL_TYPE=0)&quot;">​</a></h3><p>Це типовий тип повернення для <a href="./../flight_modes_mc/return.html">мультикоптера</a> (див. тему для отримання більш детальної інформації).</p><p>У цьому типі повернення транспортний засіб:</p><ul><li>Піднімається на безпечну <a href="#minimum-return-altitude">мінімальну висоту повернення</a> (над будь-якими очікуваними перешкодами).</li><li>Летить прямою траєкторією до вихідної позиції або точки збору (залежно від того, що ближче)</li><li>Після <a href="#loiter-landing-at-destination">прибуття</a> опускається до «висоти спуску» та чекає встановленого часу. Цей час можна використати для розгортання шасі для посадки.</li><li>Сідає або чекає (це залежить від параметрів посадки), За замовчуванням БПЛА або ВТОЛ у режимі БПЛА приземлятиметься, а повітряне судно з фіксованим крилом обертатиметься на висоті спуску. ВТОЛ у режимі FW вирівнює свою орієнтацію на точку призначення, переходить у режим МБ і потім приземлюється.</li></ul><p>:::note Якщо не визначено точки ралі, це те ж саме, що і <em>Повернення до старту</em> (RTL)/<em>Повернення додому</em> (RTH). :::</p><h3 id="тип-посадки-повернення-точки-збору-rtl-type-1" tabindex="-1">Тип посадки/повернення точки збору (RTL_TYPE=1) <a class="header-anchor" href="#тип-посадки-повернення-точки-збору-rtl-type-1" aria-label="Permalink to &quot;Тип посадки/повернення точки збору (RTL_TYPE=1)&quot;">​</a></h3><p>Це типовий тип повернення для літака з <a href="./../flight_modes_fw/return.html">фіксованим крилом</a> або <a href="./../flight_modes_vtol/return.html">VTOL</a> (див. теми для отримання додаткової інформації).</p><p>У цьому типі повернення транспортний засіб:</p><ul><li>Піднімається на безпечну <a href="#minimum-return-altitude">мінімальну висоту повернення</a> (вище будь-яких очікуваних перешкод), якщо потрібно. Транспортний засіб підтримує свою початкову висоту, якщо вона вище, ніж мінімальна висота повернення.</li><li>Летить за прямим постійним шляхом на точку ралі або на початок шаблону <a href="#mission-landing-pattern">посадки місії</a> (найближчого). Якщо місця посадки або збору не визначені, транспортний засіб повертається додому прямим шляхом.</li><li>Якщо призначення - це шаблон посадки місії, воно буде слідувати за шаблоном для посадки.</li><li>Якщо місце призначення - це точка ралі або дім, воно <a href="#loiter-landing-at-destination">приземлиться або зачекає</a> на висоті спуску (в залежності від параметрів посадки). За замовчуванням багатороторні квадрокоптери або вертикально-взлітно-посадкові літаки в режимі багатороторника приземлюються, а фіксованокрилі літаки обертаються на висоті спуску. VTOL у режимі FW вирівнює свій курс до точки призначення, переходить в режим MC, а потім приземлюється.</li></ul><p>:::note Для фіксованих крил зазвичай також встановлюється параметр <a href="#MIS_TKO_LAND_REQ">MIS_TKO_LAND_REQ</a> який <em>вимагає</em> патерн посадки за місією. :::</p><h3 id="тип-повернення-маршруту-завдання-rtl-type-2" tabindex="-1">Тип повернення маршруту завдання (RTL_TYPE=2) <a class="header-anchor" href="#тип-повернення-маршруту-завдання-rtl-type-2" aria-label="Permalink to &quot;Тип повернення маршруту завдання (RTL_TYPE=2)&quot;">​</a></h3><p>Цей тип повернення використовує місію (якщо вона визначена) для надання безпечного <em>шляху</em> повернення та <a href="#mission-landing-pattern">шаблон посадки місії</a> (якщо визначено) для забезпечення посадкової поведінки. Якщо є місія, але немає посадкового шаблону, місія летить <em>у зворотному напрямку</em>. Точки ралі, якщо вони є, ігноруються.</p><p>:::note Поведінка є досить складною, оскільки вона залежить від режиму польоту та наявності визначеної місії та посадкової місії. :::</p><p>Місія <em>з</em> посадковим шаблоном:</p><ul><li><strong>Режим місії:</strong> Місія продовжується у &quot;режимі прискореного перемотування&quot; (переходи, затримки та будь-які інші команди, що не стосуються позиції, ігноруються, точки затримки та інші позиційні точки перетворюються на прості точки) і потім здійснює посадку.</li><li><strong>Автоматичний режим, окрім режиму місії:</strong><ul><li>Підніміться до безпечної <a href="#minimum-return-altitude">мінімальної висоти повернення</a> вище будь-яких очікуваних перешкод.</li><li>Летіть безпосередньо до найближчої точки маршруту (для FW - не посадкової точки) і знижуйтеся до висоти точки маршруту.</li><li>Продовжуйте місію в режимі швидкої відтворення з цієї точки маршруту.</li></ul></li><li><strong>Ручний режим:</strong><ul><li>Підняття на безпечну <a href="#minimum-return-altitude">мінімальну висоту повернення</a> вище будь-яких очікуваних перешкод.</li><li>Прямий польот до позиції послідовності посадки та спуск до висоти позначеної точки</li><li>Приземлення з використанням місійного шаблону посадки</li></ul></li></ul><p>Місія <em>з</em> посадковим шаблоном:</p><ul><li><strong>Режим місії:</strong><ul><li>Місія виконується &quot;швидко назад&quot; (у зворотному напрямку) починаючи з попередньої точки маршруту <ul><li>Переходи, затримки та будь-які інші команди, що не стосуються позиції, ігноруються. Точки залишку та інші позиційні точки перетворюються на прості точки маршруту.</li><li>Транспортні засоби VTOL переходять у режим FW (за потреби) перед тим, як летіти місію задом наперед.</li></ul></li><li>При досягненні пункту маршруту 1 транспортний засіб піднімається на <a href="#minimum-return-altitude">мінімальну висоту повернення</a> і летить до домашньої позиції (де він <a href="#loiter-landing-at-destination">приземлюється або очікує</a>).</li></ul></li><li><strong>Режим автопілота, відмінний від режиму місії:</strong><ul><li>Летіти безпосередньо до найближчої точки маршруту (для фіксованого крила не є пунктом посадки) і спуститися на висоту цієї точки.</li><li>Продовжуйте місію у зворотному напрямку, точно так само, як буде активовано режим Повернення у режимі місії (див. вище)</li></ul></li><li><strong>Ручні режими:</strong> Політайте безпосередньо до домашньої локації та приземляйтесь.</li></ul><p>Якщо місія не визначена, PX4 буде летіти безпосередньо до домашньої локації та приземлиться (точки ралі ігноруються).</p><p>Якщо місія змінюється під час режиму повернення, тоді поведінка повторно оцінюється на основі нової місії за тими ж правилами, що й вище (наприклад, якщо нова місія не має послідовності приземлення, а ви в місії, місія змінюється).</p><h3 id="тип-повернення-додому-точка-збору-rtl-type-3" tabindex="-1">Тип повернення додому/точка збору (RTL_TYPE=3) <a class="header-anchor" href="#тип-повернення-додому-точка-збору-rtl-type-3" aria-label="Permalink to &quot;Тип повернення додому/точка збору (RTL_TYPE=3)&quot;">​</a></h3><p>У цьому типі повернення транспортний засіб:</p><ul><li>Піднімається на безпечну <a href="#minimum-return-altitude">мінімальну висоту повернення</a> (вище будь-яких очікуваних перешкод).</li><li>Летить прямо до найближчої точки призначення: домашньої локації, шаблону посадки місії або точки ралі.</li><li>Якщо місце призначення - це <a href="#mission-landing-pattern">шаблон посадки місії</a>, транспортний засіб буде дотримуватися шаблону для посадки.</li><li>Якщо місце призначення - це домашнє місце або точка ралі, транспортний засіб спускається на висоту спуску (<a href="#RTL_DESCEND_ALT">RTL_DESCEND_ALT</a>) і потім <a href="#loiter-landing-at-destination">посаджується або чекає</a>. За замовчуванням, квадрокоптер або ВТЛ у режимі квадрокоптера приземлиться, а літак кружлятиме на висоті спуску. Вертикальний злітно-посадковий апарат VTOL у режимі FW вирівнює свій курс до пункту призначення, переходить у режим MC, а потім приземляється.</li></ul><h2 id="мінімальна-висота-повернення" tabindex="-1">Мінімальна висота повернення <a class="header-anchor" href="#мінімальна-висота-повернення" aria-label="Permalink to &quot;Мінімальна висота повернення&quot;">​</a></h2><p>Для більшості <a href="#return_types">типів повернення</a> транспортний засіб підніматиметься до <em>мінімальної безпечної висоти</em> перед поверненням (якщо вже не перебуває вище цієї висоти), щоб уникнути перешкод між ним і місцем призначення.</p><p>:::note Виняток становить виконання <a href="#mission-path-return-type-rtl-type-2">повернення за маршрутом місії</a> з <em>меж місії</em>. У цьому випадку транспортний засіб слідує точкам маршруту місії, які ми припускаємо, що сплановані таким чином, щоб уникнути будь-яких перешкод. :::</p><p>Повернення на висоту для літака або ВТОЛ-транспортного засобу в режимі фіксованого крила налаштовується за допомогою параметра <a href="#RTL_RETURN_ALT">RTL_RETURN_ALT</a> (не використовує код, описаний у наступному пункті).</p><p>Повернення на висоту для багатокоптерів або ВТОЛ-транспортних засобів у режимі MC налаштовується за допомогою параметрів <a href="#RTL_RETURN_ALT">RTL_RETURN_ALT</a> та <a href="#RTL_CONE_ANG">RTL_CONE_ANG</a>, які визначають пів-конус, центрований навколо пункту призначення (домашнього місця або безпечної точки).</p><p><img src="'+a+'" alt="Return mode cone"></p><p>Якщо транспорт є:</p><ul><li>Вище <a href="#RTL_RETURN_ALT">RTL_RETURN_ALT</a> (1) він повернеться на своїй поточній висоті.</li><li>Нижче конуса він повернеться туди, де він перетинається з конусом (2) або <a href="#RTL_DESCEND_ALT">RTL_DESCEND_ALT</a> (яка б вища).</li><li>Поза конусом (3) спочатку підніметься до досягнення <a href="#RTL_RETURN_ALT">RTL_RETURN_ALT</a>.</li><li>У межах конуса: <ul><li>Вище <a href="#RTL_DESCEND_ALT">RTL_DESCEND_ALT</a> (4) він повернеться на свою поточну висоту.</li><li>Нижче <a href="#RTL_DESCEND_ALT">RTL_DESCEND_ALT</a> (5) спочатку він підніметься до <code>RTL_DESCEND_ALT</code>.</li></ul></li></ul><p>Примітка:</p><ul><li>Якщо кут <a href="#RTL_CONE_ANG">RTL_CONE_ANG</a> дорівнює 0 градусам, то &quot;конуса&quot; немає: <ul><li>транспортний засіб повертається на висоту <code>RTL_RETURN_ALT</code> (або вище).</li></ul></li><li>Якщо <a href="#RTL_CONE_ANG">RTL_CONE_ANG</a> дорівнює 90 градусам, транспортний засіб повертатиметься на велику висоту, ніж <code>RTL_DESCEND_ALT</code>, та на поточну висоту.</li><li>Транспортний засіб завжди підніметься принаймні на висоту <a href="#RTL_DESCEND_ALT">RTL_DESCEND_ALT</a> для повернення.</li></ul><h2 id="посадка-в-пункті-призначення" tabindex="-1">Посадка в пункті призначення <a class="header-anchor" href="#посадка-в-пункті-призначення" aria-label="Permalink to &quot;Посадка в пункті призначення&quot;">​</a></h2><p>Крім випадків, коли виконується <a href="#mission-landing-pattern">шаблон посадки місії</a> як частина режиму повернення, транспортний засіб прибуде до пункту призначення і швидко опуститься до висоти <a href="#RTL_DESCEND_ALT">RTL_DESCEND_ALT</a>, де він буде кружляти протягом <a href="#RTL_LAND_DELAY">RTL_LAND_DELAY</a>, перед посадкою. Якщо <code>RTL_LAND_DELAY=-1</code>, він буде багато часу кружляти.</p><p>Конфігурація за замовчуванням для посадки залежить від типу транспортного засобу:</p><ul><li>Багтороторні літальні апарати налаштовані на коротку паузу в горизонтальному положенні, розкладаючи стійки посадкової шасі за потреби, а потім сідають.</li><li>Літальні апарати з фіксованим крилом використовують режим повернення з <a href="#mission-landing-pattern">шаблоном посадки місії</a>, оскільки це дозволяє автоматизовану посадку. Якщо не використовується посадка за допомогою місії, конфігурація за замовчуванням полягає в нескінченному обертанні, щоб користувач міг взяти керування власноруч і виконати посадку.</li><li>VTOLи в режимі MC літають і сідають точно так само, як багтороторний вертоліт.</li><li>VTOLи в режимі FW рухаються до точки посадки, переходять у режим MC, а потім сідають на місце призначення.</li></ul><h2 id="схема-посадки-місіі" tabindex="-1">Схема посадки місії <a class="header-anchor" href="#схема-посадки-місіі" aria-label="Permalink to &quot;Схема посадки місії&quot;">​</a></h2><p>Шаблон посадки місії - це шаблон посадки, визначений як частина плану місії. Це включає в себе <a href="https://mavlink.io/en/messages/common.html#MAV_CMD_DO_LAND_START" target="_blank" rel="noreferrer">MAV_CMD_DO_LAND_START</a>, одне або кілька позиційних точок маршруту та <a href="https://mavlink.io/en/messages/common.html#MAV_CMD_NAV_LAND" target="_blank" rel="noreferrer">MAV_CMD_NAV_LAND</a> (або <a href="https://mavlink.io/en/messages/common.html#MAV_CMD_NAV_VTOL_LAND" target="_blank" rel="noreferrer">MAV_CMD_NAV_VTOL_LAND</a> для VTOL-транспортного засобу).</p><p>Посадкові маршрути, визначені в місіях, - це найбезпечніший спосіб автоматично посадити літак з <em>фіксованими крилами</em> на PX4. З цієї причини повітряні судна фіксованого крила налаштовані на використання <a href="#mission-landing-rally-point-return-type-rtl-type-1">Посадку/повернення на пункт ралі/вильоту місії</a> за замовчуванням.</p><h2 id="параметри" tabindex="-1">Параметри <a class="header-anchor" href="#параметри" aria-label="Permalink to &quot;Параметри&quot;">​</a></h2><p>Параметри RTL наведено в <a href="./../advanced_config/parameter_reference.html#return-mode">Довідці параметрів &gt; Режим повернення</a> (і підсумовано нижче).</p><table><thead><tr><th>Параметр</th><th>Опис</th></tr></thead><tbody><tr><td><a id="RTL_TYPE"></a><a href="./../advanced_config/parameter_reference.html#RTL_TYPE">RTL_TYPE</a></td><td>Механізм повернення (шлях і місце призначення). <br><code>0</code>: Повернення до точки ралі або додому (яка ближче) за прямим маршрутом. <br><code>1</code>: Повернення до точки ралі або початкової точки місії посадки (яка ближче) за прямим маршрутом. Якщо не визначено ні місійної посадки, ні точок ралі, повертайтеся додому через прямий шлях. Якщо місія включає посадковий маршрут, слідуємо маршруту для посадки. <br><code>2</code>: Використовуйте шлях місії, щоб швидко перейти до посадки, якщо визначений посадковий маршрут, в іншому випадку швидко повертайтеся додому. Ігноруємо точки ралі. Летіти прямо додому, якщо не визначено жодного плану місії. <br><code>3</code>: Повертатися прямим шляхом до найближчої точки призначення: дому, початку шаблону посадки місії або безпечної точки. Якщо місце призначення - це шаблон посадки місії, дотримуйтеся шаблону для посадки.</td></tr><tr><td><a id="RTL_RETURN_ALT"></a><a href="./../advanced_config/parameter_reference.html#RTL_RETURN_ALT">RTL_RETURN_ALT</a></td><td>Return altitude в метрах (за замовчуванням: 60 м), коли <a href="./../advanced_config/parameter_reference.html#RTL_CONE_ANG">RTL_CONE_ANG</a> дорівнює 0. Якщо вже вище цієї величини, транспортний засіб повернеться на поточну висоту.</td></tr><tr><td><a id="RTL_DESCEND_ALT"></a><a href="./../advanced_config/parameter_reference.html#RTL_DESCEND_ALT">RTL_DESCEND_ALT</a></td><td>Мінімальна висота повернення і висота, на якій повітряне судно сповільнює або зупиняє своє початкове зниження з вищої висоти повернення (за замовчуванням: 30 м)</td></tr><tr><td><a id="RTL_LAND_DELAY"></a><a href="./../advanced_config/parameter_reference.html#RTL_LAND_DELAY">RTL_LAND_DELAY</a></td><td>Час очікування на висоті <code>RTL_DESCEND_ALT</code> перед посадкою (за замовчуванням: 0.5 с) - за замовчуванням цей період короткий, щоб транспортний засіб просто сповільнився, а потім враз відразу приземлився. Якщо встановлено значення -1, система буде кружляти на висоті <code>RTL_DESCEND_ALT</code> замість посадки. Затримка надається для того, щоб ви могли налаштувати час для розгортання шасі для посадки (автоматично спрацьовує).</td></tr><tr><td><a id="RTL_MIN_DIST"></a><a href="./../advanced_config/parameter_reference.html#RTL_MIN_DIST">RTL_MIN_DIST</a></td><td>Мінімальна горизонтальна відстань від домашньої позиції, щоб викликати підйом на висоту повернення, вказану &quot;конусом&quot;. Якщо транспортний засіб горизонтально ближче, ніж ця відстань до дому, він повернеться на свою поточну висоту або <code>RTL_DESCEND_ALT</code> (вище з двох) замість того, щоб спочатку підніматися на RTL_RETURN_ALT.</td></tr><tr><td><a id="RTL_CONE_ANG"></a><a href="./../advanced_config/parameter_reference.html#RTL_CONE_ANG">RTL_CONE_ANG</a></td><td>Половина кута конуса, який визначає висоту повернення ВСП до домашньої позиції (RTL). Значення (у градусах): 0, 25, 45, 65, 80, 90. Зауважте, що 0 означає &quot;без конуса&quot; (завжди повертатися на <code>RTL_RETURN_ALT</code> або вище), тоді як 90 вказує на те, що транспортний засіб повинен повертатися на поточну висоту або <code>RTL_DESCEND_ALT</code> (яка вища).</td></tr><tr><td><a id="COM_RC_OVERRIDE"></a><a href="./../advanced_config/parameter_reference.html#COM_RC_OVERRIDE">COM_RC_OVERRIDE</a></td><td>Контролює, чи рух палиць на багтрековому літальному апараті (або VTOL у режимі MC) викликає зміну режиму на <a href="./../flight_modes_mc/position.html">Режим позиціонування</a> (крім випадку, коли транспортний засіб вирішує критичне аварійне вимкнення батареї). Це можна окремо увімкнути для автоматичних режимів та для режиму поза бортом, і в автоматичних режимах воно включено за замовчуванням.</td></tr><tr><td><a id="COM_RC_STICK_OV"></a><a href="./../advanced_config/parameter_reference.html#COM_RC_STICK_OV">COM_RC_STICK_OV</a></td><td>Кількість рухів стиків, яка викликає перехід у режим <a href="./../flight_modes_mc/position.html">Положення</a> (якщо <a href="#COM_RC_OVERRIDE">COM_RC_OVERRIDE</a> увімкнено).</td></tr><tr><td><a id="RTL_LOITER_RAD"></a><a href="./../advanced_config/parameter_reference.html#RTL_LOITER_RAD">RTL_LOITER_RAD</a></td><td>[Тільки фіксований крило] Радіус круга обертання (у значенні <a href="#RTL_LAND_DELAY">RTL_LAND_DELAY</a>).</td></tr><tr><td><a id="MIS_TKO_LAND_REQ"></a><a href="./../advanced_config/parameter_reference.html#MIS_TKO_LAND_REQ">MIS_TKO_LAND_REQ</a></td><td>Вкажіть, чи потрібна місія для посадки або злітної траєкторії <em>необхідна</em>. Загалом, фіксованокрилі транспортні засоби встановлюють це для вимагання патерну посадки, але ВТОЛ цього не роблять.</td></tr></tbody></table>',62),n=[o];function d(T,h,m,L,R,p){return i(),r("div",null,n)}const E=t(_,[["render",d]]);export{s as __pageData,E as default};
